import React from 'react';
import './Streamroom.css'
import Image from 'react'
function Streamroom(){
    return (
        <div className="stream">
           <div className="row">
              <Image source={require('./logo.jpg')} />
           </div>
        </div>
    );
}

export default Streamroom;
